import React, { useState } from "react";

import "./SearchPost.css";

const SearchPost = () => {
  const removeSearchForm = () => {
    const div = document.getElementsByClassName("searchPostContainer");
    div.remove();
  };
  return (
    <div className="searchPostContainer" onClick={removeSearchForm}>
      <button className="searchOffBtn">닫기</button>
      <input type="text" />
      <div>입력 후 엔터를 눌러주세요</div>
    </div>
  );
};

export default SearchPost;
